import React from 'react';
import { Switch, Route } from "react-router-dom";
import Home from '../Home/Home';
import ContactUs from '../ContactUs/ContactUs';
import GetKenyaQuotes from '../GetQuotes/GetKenyaQuotes';

const Routes = () => {
    return(
        <main>
            <Switch>
                <Route
                    path="/"
                    exact
                    component={Home}
                />
                <Route
                    path="/contact"
                    exact
                    component={ContactUs}
                />
                <Route
                    path="/GetKenyaQuotes"
                    exact
                    component={GetKenyaQuotes}
                />
            </Switch>
        </main>
    );
}

export default Routes;
